import styled from 'styled-components';


export const StyledDiv = styled.div`
  background-color: black;
  border: 1px solid black;
  padding: 4px 10px;
  color: white;
  height:300px;
  width:200px
  margin:2px;
`

export const Image = styled.img`
height:150px;
width:150px;
`
